def test_PATH():
    for test_index, binary in enumerate(PATH_TEST_CASES):
        path = TypePATH().from_bytes(binary)
        assert path.to_bytes() == binary
        description = path.to_value()
        reconstituted = TypePATH().from_value(description)
        assert reconstituted.to_bytes() == binary, [description, reconstituted, path, reconstituted.to_bytes(), binary]

    binary = b"PTH0\x00\x00\x00'\x00\x00\x00\x03\x07<menus>\x08Controls\x11Signal Processing"
    path = TypePATH().from_bytes(binary)
    expected_str = '/<menus>/Controls/Signal Processing'
